01-introduction/02-utilisation.html.body:
Utilisation de Webpack

En ligne de commande (installation globale) :

webpack

Depuis un script Node

var webpack = require("webpack");

webpack({
  // configuration
}, function(err, stats) {
  // ...
});

Structure de projet par défaut Webpack :
/dist
    index.html
    main.js (fichier généré par Webpack)
/src
    index.js
    autreModule1.js
    autreModule2.js
    /autreModule3
        autreModule31.js

02-configuration/.body:
Configuration
La configuration Webpack se fait via un fichier JavaScript.
Par défaut, il s'agit du fichier webpack.config.js.
4 concepts principaux :

entry : points d'entrée prise en compte par Webpack;
output : sortie webpack;
loaders : configuration de chargement de fichiers de différents formats;
plugins : plugins webpack.

02-configuration/01-entry.html.body:
Entry
Webpack crée le graphe de toutes les dépendences de l'application.
Les points d'entrée définissent à Webpack où commencer.
Exemple de point d'entrée :
module.exports = {
  entry: './src/app.js'
}


Il est possible de définir plusieurs points d'entrée.
module.exports = {
  entry: {
    app: './src/app.js',
    vendors: './src/vendors.js'
  }
}

02-configuration/02-output.html.body:
Output
La propriété output définit le ou les fichier(s) de sortie de Webpack.
var path = require('path');

module.exports = {
  entry: './src/app.js',
  output: {
    path: path.resolve(__dirname, 'dist'),
    filename: 'app.bundle.js'
  }
}

Dans ce cas, le fichier généré sera ./dist/app.bundle.js.

02-configuration/03-loaders.html.body:
Loaders
Webpack, par défaut, ne sait interpréter comme module uniquement du code JavaScript.
Pour que d'autres types de ressources (CSS, HTML, ...) puissent être utilisés comme module, il faut configurer des loaders dédiés.
La configuration module.rules précise les loaders pris en charge.
module.exports = {
  ...
  module: {
    rules: [ ... ]
  }
}

Exemple avec css-loader (à installer via npm install --save-dev css-loader).
module.exports = {
  ...
  module: {
    rules: [
        { test: /\.css$/, use: 'css-loader'}
    ]
  }
}

// Il devient alors possible de charger des fichiers CSS
require("./mon.fichier.css");

Configurer plusieurs loaders.
npm install --save-dev css-loader
npm install --save-dev ts-loader
module.exports = {
  ...
  module: {
    rules: [
        { test: /\.css$/, use: 'css-loader'},
        { test: /\.ts$/, use: 'ts-loader' }
    ]
  }
}

04-travaux-pratiques/.body:
Travaux Pratiques
Premier pas

Créer un répertoire :

/premiers-pas-webpack

Initialiser un projet NPM

cd premiers-pas-webpack
npm init -y

Installer Webpack

npm install webpack --save-dev

Installer le client Webpack

npm install --save-dev webpack-cli

Visualiser le répertoire node_modules/.bin.


Créer les fichiers dist/index.html, src/index.js et src/serviceTitre.js.

/premiers-pas-webpack
    /dist
        index.html
    /src
        index.js
        serviceTitre.js

Compléter le fichier dist/index.html :






    Démo Webpack








Compléter le fichier src/serviceTitre.js :

// insérer titre
export function insererTitre() {
    document.querySelector('body').insertAdjacentHTML('afterbegin', 'Démo Webpack');
